import React, { useState, useEffect } from 'react';
import * as monaco from 'monaco-editor';

const VHDLEditor = ({ onCodeChange, initialCode, id }) => {
  useEffect(() => {
    const editorInstance = monaco.editor.create(document.getElementById(id), {
      value: initialCode, // Изначальный код передаваемый из родительского компонента
      language: 'vhdl',
      theme: 'vs-dark',
      automaticLayout: true,
    });

    // Отслеживаем изменения в редакторе
    const debounceChangeHandler = debounce(() => {
      const code = editorInstance.getValue();
      onCodeChange(code); // Передаем код в родительский компонент
    }, 300); // Задержка в 300ms

    editorInstance.onDidChangeModelContent(debounceChangeHandler);

    return () => {
      editorInstance.dispose(); // Очистка редактора при удалении компонента
    };
  }, [initialCode, onCodeChange, id]);

  return <div id={id} style={{ height: '200px', width: '100%' }}></div>;
};

// Функция debounce, которая задерживает вызов
function debounce(func, wait) {
  let timeout;
  return function () {
    const context = this;
    const args = arguments;
    clearTimeout(timeout);
    timeout = setTimeout(() => func.apply(context, args), wait);
  };
}

const CompilerConsole = ({ output }) => {
  return (
    <div className="compiler-console" style={{ marginTop: '20px', padding: '10px', background: '#f4f4f4', borderRadius: '4px' }}>
      <h3>Консоль:</h3>
      <pre>{output}</pre>
    </div>
  );
};

const VHDLEditorWithCompiler = () => {
  // Состояния для разных окон
  const [vhdlCode, setVhdlCode] = useState(`-- Архитектура VHDL`);
  const [testbenchCode, setTestbenchCode] = useState(`-- Тестовый стенд`);
  const [architectureCode, setArchitectureCode] = useState(`-- Ваш код архитектуры`);
  const [output, setOutput] = useState('');

  // Функция для компиляции кода
  const compileCode = async () => {
    try {
      const response = await fetch('http://localhost:5000/compile-vhdl', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          vhdlCode,
          testbenchCode,
          architectureCode,
        }), // Отправляем все данные на сервер
      });

      const result = await response.text(); // Получаем результат компиляции
      setOutput(result); // Отображаем результат компиляции в консоли
    } catch (error) {
      setOutput('Ошибка компиляции: ' + error.message); // Если ошибка, выводим её
    }
  };

  // Обновляем код из редакторов
  const handleVHDLChange = (code) => setVhdlCode(code);
  const handleTestbenchChange = (code) => setTestbenchCode(code);
  const handleArchitectureChange = (code) => setArchitectureCode(code);

  return (
    <div style={{ display: 'flex', flexDirection: 'column', gap: '20px' }}>
      {/* Архитектура */}
      <div>
        <h3>Архитектура:</h3>
        <VHDLEditor onCodeChange={handleArchitectureChange} initialCode={architectureCode} id="architecture-editor" />
      </div>

      {/* Тестовый стенд */}
      <div>
        <h3>Тестовый стенд:</h3>
        <VHDLEditor onCodeChange={handleTestbenchChange} initialCode={testbenchCode} id="testbench-editor" />
      </div>

      {/* Основной VHDL код */}
      <div>
        <h3>Основной VHDL Код:</h3>
        <VHDLEditor onCodeChange={handleVHDLChange} initialCode={vhdlCode} id="vhdl-editor" />
      </div>

      {/* Кнопка компиляции */}
      <button
        onClick={compileCode}
        style={{
          padding: '10px 20px',
          backgroundColor: '#007bff',
          color: 'white',
          border: 'none',
          borderRadius: '4px',
          cursor: 'pointer',
        }}
      >
        Компилировать
      </button>

      {/* Консоль */}
      <CompilerConsole output={output} />
    </div>
  );
};

export default VHDLEditorWithCompiler;
